import React from 'react'

const VehicleModel = () => {
    return (
        <div style={{display:"flex", flexDirection:"Column", marginLeft:"auto", marginRight:"auto"}}>
            <p style={{display:"flex", flexDirection:"Column"}}>
                <span style={{fontWeight:"bold", fontSize:"25px", fontFamily:"helvertica"}}>Vehicle Models</span>
                <span style={{fontWeight:"bold", fontSize:"40px", fontFamily:"helvertica"}}>Our rental fleet</span>
                <span style={{color:"grey"}}>Choose from a variety of our amazing vehicles to rent for your next<br></br> 
                adventure or business trip</span>
            </p>
        </div>
    )
}
export default VehicleModel;
